import React from "react";
import { Link } from "react-router-dom";

function TopPage() {
  return (
    <div>
      <h4>Top page</h4>
      <div>
        <div>
          <Link to="/live/100/teacher">Teacher Page</Link>
        </div>
        <div>
          <Link to="/live/100/student">Student Page</Link>
        </div>
      </div>
    </div>
  );
}

export default TopPage;
